import PropTypes from 'prop-types';

const DataCard = ({ data }) => {
	const results = data.data;

	const resultsArr = results.map(items => {
		return items;
	});

	console.log(resultsArr[0]);

	//const oneArr = resultsArr[0].concat(resultsArr[1]);

	return <h1>DataCard</h1>;
};

DataCard.propTypes = {
	DataCard: PropTypes.func.isRequired,
	data: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
	data: state.data
});

export default connect(mapStateToProps)(DataCard);
